import React from 'react';
import { Provider } from 'react-redux';
import store from './redux/store';
import CustomerList from './components/CustomerList';

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <CustomerList />
        <h2> Hello</h2>
      </div>
    // </Provider>
  );
}

export default App;

